import './header.css';
import logo from './logo-w.svg';

const header = ()=>{
    return(
        <header>
            <h1><a href="#"><img src={logo} alt="socar"/></a></h1>
            <div>
                <span></span>
                <span></span>
            </div>
        </header>
    )
}
export default header;
